    [],nt"revision_timestamp": "2016-03-28T18:45:05.203537",nt"name": "enhanced-biological-sampling-data",nt"isopen":
    false,nt"url": null,nt"notes": "This is a database of a variety of biological,
    reproductive, and energetic data collected from fish on the continental shelf in
    the northwest Atlantic Ocean. Species sampled in this database thus far include
    winter flounder, yellowtail flounder, summer flounder, haddock, cusk, Atlantic wolffish,
    and Atlantic herring. Data are collected from fish provided principally from fishermen
    participating in the NECRP Study Fleet. Some fish are taken from other NECRP research
    studies, and a small number from NEFSC surveys and surveys by MADMF and URI GSO.
    The catch location data is provided in views from the relevant FVTR, SVDBS, or other
    tables for a few cooperative research or external programs.  The biological data
    includes general physical data (weights, lengths, organ weights, macroscopic maturity
    stage), age data, and other reproductive data. Measures collected from preserved
    gonad samples includes data for estimation of fish fecundity (oocyte counts and
    diameters) and from grading gonad histology for determination of maturity and seasonal
    reproductive status. In addition, relative measures of energetic condition are collected
    (including tissue wet weight and dry weights and bioimpedance data), and for some
    fish food habits data were collected in the first 18 months of data collection.
